      <h1 className='titulo-principal'>Filmes exclusivos dos maiores estúdios<span>É só dar um play</span></h1>
        <p className='subtitulo-chamada'>Curta 7 dias grátis, assine por R$37,90/mês e cancele quando quiser.</p>
        <button className='botao-chamada'>Experimente grátis</button>
      </header>
    </div>
  );
}

export default App;
